import React from 'react'
import './heroStyle.css'

export default function Hero(id, title, link) {
  return (
    <div className='hero'>
     
      <div className='image-sec'>
       <img alt='image'
       src={props.link}/>
        
      </div>
      <h1>{props.title}</h1>
    </div>
  )
}
